aws:cdk:cloudformation:props.definition:
schema {
  query: Query
  mutation: Mutation
  subscription: Subscription
}
type Language {
  code: String!
  name: String!
}
type Country {
  code: ID!
  name: String!
  currency: String!
  languages: [Language!]!
}
type Continent {
  code: ID!
  name: String!
  countries: [Country!]!
}
input StringQueryOperatorInput {
  eq: String
  ne: String
  gt: String
  gte: String
  lt: String
  lte: String
  in: String
  notIn: String
  regex: String
}
input ContinentFilterInput {
  code: StringQueryOperatorInput
}
type Query {
  continents(filter: ContinentFilterInput!): [Continent!]!
  allContinents: ContinentConnection!
  countries(filter: CountryFilterInput!): [Country!]!
  allCountries: CountryConnection!
  language(code: String!): Language!
  languages(filter: LanguageFilterInput): [Language!]!
  countryDate(countryId: ID! dateType: DateType!): AWSDate!
  countryTime(countryId: ID! dateType: DateType!): AWSTime!
  countryDateTime(countryId: ID! dateType: DateType!): AWSDateTime!
  countryTimestamp(countryId: ID! dateType: DateType!): AWSTimestamp!
  countryDates(countryId: ID! dateType: DateType!): [AWSDate!]!
  countryTimes(countryId: ID! dateType: DateType!): [AWSTime!]!
  countryDateTimes(countryId: ID! dateType: DateType!): [AWSDateTime!]!
  countryTimestamps(countryId: ID! dateType: DateType!): [AWSTimestamp!]!
  countryByDate(countryId: ID! dateType: DateType! date: AWSDate!): Country!
  countryByTime(countryId: ID! dateType: DateType! time: AWSTime!): Country!
  countryByDateTime(countryId: ID! dateType: DateType! dateTime: AWSDateTime!): Country!
  countryByTimestamp(countryId: ID! dateType: DateType! timestamp: AWSTimestamp!): Country!
  countriesByDates(countryId: ID! dateType: DateType! dates: [AWSDate!]!): [Country!]!
  countriesByTimes(countryId: ID! dateType: DateType! times: [AWSTime!]!): [Country!]!
  countriesByDateTimes(countryId: ID! dateType: DateType! dateTimes: [AWSDateTime]!): [Country!]!
  countriesByTimestamps(countryId: ID! dateType: DateType! timestamps: [AWSTimestamp]!): [Country!]!
}
type ContinentEdge {
  node: Continent!
  cursor: String!
}
type PageInfo {
  previousPageCursor: String
  nextPageCursor: String
}
type ContinentConnection {
  edges: [ContinentEdge!]!
  nodes: [Continent!]!
  totalCount: Int!
  pageInfo: PageInfo
}
input CountryFilterInput {
  code: StringQueryOperatorInput
  currency: StringQueryOperatorInput
  continent: StringQueryOperatorInput
}
type CountryEdge {
  node: Country!
  cursor: String!
}
type CountryConnection {
  edges: [CountryEdge!]!
  nodes: [Country!]!
  totalCount: Int!
  pageInfo: PageInfo
}
input LanguageFilterInput {
  code: StringQueryOperatorInput
}
enum DateType {
  DISCOVERED
  SETTLED
}
input LanguageInput {
  code: String!
  name: String!
}
input CountryInput {
  code: ID!
  name: String!
  currency: String!
  languages: [LanguageInput!]!
}
type Mutation {
  addCountry(country: CountryInput!): Country!
  updateCountry(country: CountryInput!): Country!
}
type Subscription {
  addedCountry(code: ID): Country!
  @aws_subscribe(mutations: ["addCountry"])
}
